const ServicesApi = [
    {
       name : 'Web Development',
       img:img1,
       btn:'Web Development'
    }, 
    {
       name : 'App Development',
       img:img2,
       btn:'App Development'
    } ,
    {
       name : 'Reapairing',
       img:img3,
       btn:'Repair'
    }, 
    {
       name : 'Web Development',
       img:img1,
       btn:'Web Development'
    }, 
    {
       name : 'App Development',
       img:img2,
       btn:'App Development'
    } ,
    {
       name : 'Reapairing',
       img:img3,
       btn:'Repair'
    } 
    
    
];

export default ServicesApi;
